    name: SECTION 5.3
    sectionNumber: '5.3'
    sectionTitle: Inclusion Criteria
    text: '<p>Patients may be included in the study only if they meet <strong>all</strong>
      the following criteria:</p><table><tr><td style="vertical-align: top; text-align:
      left"><p>1</p></td><td style="vertical-align: top; text-align: left"><p>Subjects
      shall be between <usdm:ref klass="StudyDesignPopulation" id="StudyDesignPopulation_1"
      attribute="plannedMinimumAge"/> and <usdm:ref klass="StudyDesignPopulation"
      id="StudyDesignPopulation_1" attribute="plannedMaximumAge"/></p></td></tr><tr><td
      style="vertical-align: top; text-align: left"><p>2</p></td><td style="vertical-align:
      top; text-align: left"><p><usdm:ref klass="StudyDesignPopulation" id="StudyDesignPopulation_1"
      attribute="description"/> as defined by the NINCDS and the ADRDA guidelines
      (Attachment LZZT.7)</p></td></tr><tr><td style="vertical-align: top; text-align:
      left"><p>3</p></td><td style="vertical-align: top; text-align: left"><p><usdm:ref
      klass="Activity" id="Activity_6" attribute="label"/> score of 10 to 23</p></td></tr></table>'
- id: 844
  properties:
    _type: NarrativeContent
    childrenIds: []
    id: NarrativeContent_25
    label: NarrativeContent_25
    name: SECTION 5.4
    sectionNumber: '5.4'
    sectionTitle: Exclusion Criteria
    text: '<p>Patients may be excluded in the study for <strong>any</strong> of the
      following reasons:</p><table><tr><td style="vertical-align: top; text-align:
      left"><p>9</p></td><td style="vertical-align: top; text-align: left"><p>Persons
      who have previously completed or withdrawn from this study or any other study
      investigating xanomeline TTS or the oral formulation of xanomeline.</p></td></tr></table>'
